import React from 'react';
import { Button } from 'react-bootstrap';

const AllPolls = (props) => {
  return (
    <>
    <p>All polls will be displayed here</p>
    <Button
     variant = 'secondary'
     onClick = {props.handleClick}
    >
      Back
    </Button>
    </>
  );
}

export default AllPolls;
